import xml.etree.ElementTree as ET
import pandas as pd
import csv
import os
import tkinter as tk
from tkinter import filedialog
from tkinter import messagebox
import base64
from io import BytesIO
from PIL import Image, ImageTk

# Função para selecionar o diretório do XML
def selecionar_caminho_xml():
    caminho = filedialog.askdirectory(title="Selecione o diretório dos arquivos XML")
    entrada_caminho_xml.delete(0, tk.END)
    entrada_caminho_xml.insert(0, caminho)

# Função para selecionar o arquivo de saída completo (.csv)
def selecionar_caminho_relatorio_completo():
    caminho = filedialog.asksaveasfilename(defaultextension=".csv", filetypes=[("CSV files", "*.csv")], title="Selecione o arquivo para salvar o relatório completo")
    entrada_caminho_relatorio_completo.delete(0, tk.END)
    entrada_caminho_relatorio_completo.insert(0, caminho)

# Função para selecionar o arquivo de saída resumido (.xlsx)
def selecionar_caminho_relatorio_resumido():
    caminho = filedialog.asksaveasfilename(defaultextension=".xlsx", filetypes=[("Excel files", "*.xlsx")], title="Selecione o arquivo para salvar o relatório resumido")
    entrada_caminho_relatorio_resumido.delete(0, tk.END)
    entrada_caminho_relatorio_resumido.insert(0, caminho)

# Função principal que executa o processamento
def executar():
    caminho_xml = entrada_caminho_xml.get()
    caminho_relatorio_vendas_completo = entrada_caminho_relatorio_completo.get()
    caminho_relatorio_vendas_resumido = entrada_caminho_relatorio_resumido.get()

    if not caminho_xml or not caminho_relatorio_vendas_completo or not caminho_relatorio_vendas_resumido:
        messagebox.showwarning("Atenção", "Por favor, preencha todos os campos.")
        return

    # Verificar extensões dos arquivos
    if not caminho_relatorio_vendas_completo.lower().endswith('.csv'):
        messagebox.showwarning("Atenção", "O arquivo do relatório completo deve ter a extensão '.csv'.")
        return

    if not caminho_relatorio_vendas_resumido.lower().endswith('.xlsx'):
        messagebox.showwarning("Atenção", "O arquivo do relatório resumido deve ter a extensão '.xlsx'.")
        return

    # Aqui começa o processamento dos arquivos
    produtos = {}

    def inserir_produto(nome, codigo, data, undMedida, vrUnitario, qtdItem, fornecedor, cnpj, custoTotalItem, NFE, CHAVE):
        if nome not in produtos:
            produtos[nome] = []
        produtos[nome].append({
            "nome": nome,
            "codigo": codigo,
            "data": data,
            "undMedida": undMedida,
            "valorUnitario": vrUnitario,
            "quantidade": qtdItem,
            "fornecedor": fornecedor,
            "cnpj": cnpj,
            "custo": custoTotalItem,
            "NFE": NFE,
            "CHAVE": CHAVE
        })

    def leituraXML(caminho):

        # Carrega o arquivo XML
        tree = ET.parse(caminho)
        root = tree.getroot()

        infCFe = root.find(".//infCFe")
        chave_eletronica = "'" + infCFe.attrib['Id'][3:]
        data_emissao = root.find(".//dEmi").text
        data_emissao_formatada = "{}/{}/{}".format(data_emissao[6:8], data_emissao[4:6], data_emissao[0:4])

        meio_de_pagamento = root.find(".//cMP").text[1]
        meios_pagamento = {
            "1": "Dinheiro",
            "2": "Cheque",
            "3": "Cartão de Crédito",
            "4": "Cartão de Débito",
            "5": "Cartão Refeição/Alimentação",
            "6": "Vale Refeição/Alimentação (em papel)",
            "7": "Outros"
        }
        meio_de_pagamento = meios_pagamento.get(meio_de_pagamento, "Outros")

        try:
            for det in root.findall(".//det"):
                prod = det.find("./prod")
                codigo_produto = prod.find("cProd").text
                nome_produto = prod.find("xProd").text
                NCM = prod.find("NCM").text
                CFOP = prod.find("CFOP").text
                unidade_medida = prod.find("uCom").text
                qtd_item = prod.find("qCom").text.replace(".", ",")
                valor_unitario = prod.find("vUnCom").text.replace(".", ",")
                valor_total_item = prod.find("vItem").text.replace(".", ",") if prod.find("vItem") is not None else None

                writer.writerow([
                    codigo_produto, nome_produto, NCM, CFOP, unidade_medida,
                    qtd_item, valor_unitario, valor_total_item,
                    data_emissao_formatada, meio_de_pagamento, chave_eletronica
                ])
        except Exception as e:
            print(f"Ocorreu um erro no arquivo {caminho}!")
            print(f"Descrição do erro: {e}")

    def extensao_arquivo(caminho):
        return os.path.splitext(caminho)[1]

    def ler_todos_arquivos_xml(diretorio):
        contador = 0
        for raiz, subdiretorios, arquivos in os.walk(diretorio):
            for nome_arquivo in arquivos:
                caminho_completo = os.path.join(raiz, nome_arquivo)
                if ('.XML' in extensao_arquivo(caminho_completo).upper()):
                    try:
                        leituraXML(caminho_completo)
                        contador += 1
                        print(f"Cupom {contador} concluído.")
                    except Exception as e:
                        print(f"Erro no arquivo XML {caminho_completo}")
                        print(f"Descrição do erro: {e}")

    # Início da leitura dos arquivos XML
    with open(caminho_relatorio_vendas_completo, mode='w', newline='', encoding='ISO-8859-1') as file:
        writer = csv.writer(file, delimiter=';')
        writer.writerow([
            "Codigo", "Nome", "NCM.", "CFOP", "UNID. MEDIDA", "QTD",
            "VALOR UNITARIO", "VALOR TOTAL", "DATA EMISSAO",
            "MEIO DE PAGAMENTO", "CHAVE ELETRONICA"
        ])
        ler_todos_arquivos_xml(caminho_xml)

    # Agrupamento de vendas
    df = pd.read_csv(caminho_relatorio_vendas_completo, sep=';', encoding='ISO-8859-1')
    df['VALOR TOTAL'] = df['VALOR TOTAL'].str.replace(',', '.').astype(float)
    resultado = df.groupby(['DATA EMISSAO', 'MEIO DE PAGAMENTO'])['VALOR TOTAL'].sum().reset_index()
    resultado.to_excel(caminho_relatorio_vendas_resumido, index=False, engine='openpyxl')

    messagebox.showinfo("Concluído", "Processamento finalizado com sucesso!")





# Criação da janela principal
janela = tk.Tk()
janela.title("Processamento de Vendas - Cupom Eletrônico")


# Bloquear a janela para que não possa ser maximizada
janela.resizable(False, False)
source_var = tk.StringVar()
destination_var = tk.StringVar()
# String base64 do ícone .ico
icon_base64 = ''

# Decodifica a string base64
icon_data = base64.b64decode(icon_base64)
icon_image = Image.open(BytesIO(icon_data))

# Converte a imagem para um PhotoImage
icon_photo = ImageTk.PhotoImage(icon_image)

# Define o ícone da janela
janela.iconphoto(True, icon_photo)        



# Labels e campos de entrada
tk.Label(janela, text="Diretório dos arquivos XML:").grid(row=0, column=0, padx=10, pady=5, sticky='e')
entrada_caminho_xml = tk.Entry(janela, width=50)
entrada_caminho_xml.grid(row=0, column=1, padx=10, pady=5)
btn_caminho_xml = tk.Button(janela, text="Selecionar", command=selecionar_caminho_xml)
btn_caminho_xml.grid(row=0, column=2, padx=10, pady=5)

tk.Label(janela, text="Arquivo para salvar o relatório completo (.csv):").grid(row=1, column=0, padx=10, pady=5, sticky='e')
entrada_caminho_relatorio_completo = tk.Entry(janela, width=50)
entrada_caminho_relatorio_completo.grid(row=1, column=1, padx=10, pady=5)
btn_caminho_relatorio_completo = tk.Button(janela, text="Selecionar", command=selecionar_caminho_relatorio_completo)
btn_caminho_relatorio_completo.grid(row=1, column=2, padx=10, pady=5)

tk.Label(janela, text="Arquivo para salvar o relatório resumido (.xlsx):").grid(row=2, column=0, padx=10, pady=5, sticky='e')
entrada_caminho_relatorio_resumido = tk.Entry(janela, width=50)
entrada_caminho_relatorio_resumido.grid(row=2, column=1, padx=10, pady=5)
btn_caminho_relatorio_resumido = tk.Button(janela, text="Selecionar", command=selecionar_caminho_relatorio_resumido)
btn_caminho_relatorio_resumido.grid(row=2, column=2, padx=10, pady=5)

# Botão para executar o processamento
btn_executar = tk.Button(janela, text="Executar", command=executar, width=20, bg='green', fg='white')
btn_executar.grid(row=3, column=1, padx=10, pady=20)

janela.mainloop()
